import "./index.css";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Dojo blog</h1>
      <div className="links">
        <Link href="/">Home </Link>
        <Link
          href="/create"
        >
          create
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
